import React, { Component } from 'react';

class Announce_post extends Component {
    render() { 
        return (  
            <div>
                  <table class="table table-hover">
    <thead>
      <tr>
        <th>{this.props.name}</th>
      </tr>
    </thead>
    <tbody>
    <tr>
        <td>Product Name</td>
        <td>Date</td>
        <td>Action</td>
      </tr>
      <tr>
        <td>{this.props.post.name}</td>
        <td>{this.props.post.date}</td>
        <td><button className="btn btn-info">Delete</button></td>
      </tr>
     
    </tbody>
  </table>
            </div>
        );
    }
}
 
export default Announce_post;
